In the ocean is where I am 🫶

After almost two decades of being away from the sport I set a personal goal to finish a 5km swim in under two hours. Last week at the @miniorange_security @endurosportsgoa I swam it in 1:33:29 . 

Spent a moment thanking the ocean on my way out for keeping everyone safe and free of jellyfish and most importantly bringing me back home always. 

Feel blessed that I get to do this and share the ocean with some amazing humans everyday 
@nishamaryp @kish @agarwaltanaya @bear_faced_  @jack_easy_way @simon_ajoba thank you ♥️

@goaowsclub @arubose thank you for creating a space and triggering the motivation to get back into the water🫶

@endurosportsgoa thank you for providing an encouraging environment to all of us participants and for reuniting me with someone who has known my competitive journey since I was 5! @zarirbaliwalla what an honour to share the love of swimming and our waters with you. Forever grateful for your contribution to the sport of swimming, encouragement and support 🫶🌊

🍍🌊✌️
